import "./chart.css";
import {
  LineChart,
  Line,
  XAxis,
  CartesianGrid,
  Tooltip,
  ResponsiveContainer,
} from "recharts";
import react, { useEffect, useState } from "react";
import axios from "axios";
import Histogram from 'react-chart-histogram';

export default function Chart({ title}) {
  const [data, setData] = useState([])
const labels = [ "Jan", "Feb", "March","April", "May", "June", "July","Aug","Sept","Oct","Nov","Dec"]
  const options = { fillColor: '#FFFFFF', strokeColor: '#0000FF' };
useEffect(() => {
    const salary = [];

    axios.get("https://dummy.restapiexample.com/api/v1/employees").then(response =>{
        console.log("response", response)
        response.data.data.map(item => {
          console.log("item", item)
            salary.push(item.employee_salary);            
        })
        setData(salary)
        console.log("salary", salary)
    }).catch(e => {
        alert(e);
    })
}, [])

  return (
    <div className="chart">
      <h3 className="chartTitle">{title}</h3>
      <ResponsiveContainer width="100%" aspect={3}>
      <div>
      <Histogram
          xLabels={labels}
          yValues={data}
          width='1000px'
          height='500px'
          options={options}
      />
    </div>
    </ResponsiveContainer>
    </div>
  );
}
